import React, { useState } from 'react';
import {
  createColumnHelper,
  flexRender,
  getCoreRowModel,
  getSortedRowModel,
  useReactTable,
} from '@tanstack/react-table';
import { format } from 'date-fns';
import { ChevronUpIcon, ChevronDownIcon, PencilIcon, TrashIcon } from '@heroicons/react/24/outline';

const columnHelper = createColumnHelper();

// Status badge component
const StatusBadge = ({ status }) => {
  const statusClasses = {
    'Pending': 'bg-yellow-100 text-yellow-800',
    'Sale': 'bg-green-100 text-green-800',
    'No Answer': 'bg-gray-100 text-gray-800',
    'Follow-up Later': 'bg-blue-100 text-blue-800',
    'Not Interested': 'bg-red-100 text-red-800',
    'Wrong Number': 'bg-purple-100 text-purple-800',
    'Invalid': 'bg-gray-100 text-gray-800',
  };

  const badgeClass = statusClasses[status] || 'bg-gray-100 text-gray-800';

  return (
    <span className={`inline-flex items-center rounded-full px-2.5 py-0.5 text-xs font-medium ${badgeClass}`}>
      {status}
    </span>
  );
};

export default function CallbacksTable({ data, onEdit, onDelete }) {
  const [sorting, setSorting] = useState([
    { id: 'follow_up_date', desc: false }, // Default sort by follow-up date ascending
  ]);

  const columns = [
    columnHelper.accessor('customer_name', {
      header: 'Customer',
      cell: info => info.getValue(),
    }),
    columnHelper.accessor('callback_number', {
      header: 'Phone',
      cell: info => info.getValue(),
    }),
    columnHelper.accessor(row => `${row.car_year || ''} ${row.car_make || ''} ${row.car_model || ''}`.trim(), {
      id: 'vehicle',
      header: 'Vehicle',
      cell: info => info.getValue() || '-',
    }),
    columnHelper.accessor('product', {
      header: 'Product',
      cell: info => info.getValue() || '-',
    }),
    columnHelper.accessor('follow_up_date', {
      header: 'Follow-up Date',
      cell: info => {
        const value = info.getValue();
        return value ? format(new Date(value), 'MM/dd/yyyy') : '-';
      },
    }),
    columnHelper.accessor('status', {
      header: 'Status',
      cell: info => <StatusBadge status={info.getValue()} />,
    }),
    columnHelper.accessor('agent_name', {
      header: 'Agent',
      cell: info => info.getValue() || '-',
    }),
    columnHelper.accessor('lead_score', {
      header: 'Lead Score',
      cell: info => info.getValue()?.toFixed(1) || '-',
    }),
    columnHelper.accessor('last_modified', {
      header: 'Last Modified',
      cell: info => format(new Date(info.getValue()), 'MM/dd/yyyy HH:mm'),
    }),
    columnHelper.display({
      id: 'actions',
      header: 'Actions',
      cell: ({ row }) => (
        <div className="flex space-x-2">
          <button
            onClick={() => onEdit(row.original)}
            className="text-gray-500 hover:text-primary-600"
            title="Edit"
          >
            <PencilIcon className="h-5 w-5" />
          </button>
          <button
            onClick={() => onDelete(row.original.id)}
            className="text-gray-500 hover:text-red-600"
            title="Delete"
          >
            <TrashIcon className="h-5 w-5" />
          </button>
        </div>
      ),
    }),
  ];

  const table = useReactTable({
    data,
    columns,
    state: {
      sorting,
    },
    onSortingChange: setSorting,
    getCoreRowModel: getCoreRowModel(),
    getSortedRowModel: getSortedRowModel(),
  });

  return (
    <div className="overflow-x-auto">
      <table className="min-w-full divide-y divide-gray-300">
        <thead className="bg-gray-50">
          {table.getHeaderGroups().map(headerGroup => (
            <tr key={headerGroup.id}>
              {headerGroup.headers.map(header => (
                <th
                  key={header.id}
                  scope="col"
                  className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900"
                  style={{ width: header.id === 'actions' ? '80px' : 'auto' }}
                >
                  {header.isPlaceholder ? null : (
                    <div
                      className={
                        header.column.getCanSort()
                          ? 'flex items-center cursor-pointer select-none'
                          : ''
                      }
                      onClick={header.column.getToggleSortingHandler()}
                    >
                      {flexRender(header.column.columnDef.header, header.getContext())}
                      {{
                        asc: <ChevronUpIcon className="ml-1 h-4 w-4" />,
                        desc: <ChevronDownIcon className="ml-1 h-4 w-4" />,
                      }[header.column.getIsSorted()] ?? null}
                    </div>
                  )}
                </th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody className="divide-y divide-gray-200 bg-white">
          {table.getRowModel().rows.length > 0 ? (
            table.getRowModel().rows.map(row => (
              <tr 
                key={row.id}
                className="hover:bg-gray-50 cursor-pointer"
                onClick={() => onEdit(row.original)}
              >
                {row.getVisibleCells().map(cell => (
                  <td
                    key={cell.id}
                    className="whitespace-nowrap px-3 py-4 text-sm text-gray-500"
                    onClick={e => {
                      // Prevent row onClick when clicking action buttons
                      if (cell.column.id === 'actions') {
                        e.stopPropagation();
                      }
                    }}
                  >
                    {flexRender(cell.column.columnDef.cell, cell.getContext())}
                  </td>
                ))}
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan={columns.length} className="px-3 py-4 text-sm text-gray-500 text-center">
                No callbacks found
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
}
